import small from '../images/main_small.png'
import big from  '../images/main_large.png'
const Nav =({minimal,authToken,setShowModal})=>{

        const handleClick = ()=>
        {
            setShowModal(true)
        }
    return (
        <nav>
            <div className="logo-container">
                <img className="logo" src={minimal ? small : big}></img>
                //style={{ width: '200px', height: 'auto' }}/>
            </div>

                {!authToken && !minimal &&<button className='nav-button' onClick={handleClick
                }>Log in</button>}
        </nav>
    )
}
export default Nav
